# Find the reverse complement of a DNA string.

# Given: A DNA string Pattern.

# Return: Pattern, the reverse complement of Pattern.

Nucleotide = ""
#print(Nucleotide)
def compliment(Nucleotide):
    comp = []
    for i in Nucleotide:
        if i == "T":
            comp.append("A")
        if i == "A":
            comp.append("T")
        if i == "G":
            comp.append("C")
        if i == "C":
            comp.append("G")

    return ''.join(comp)
#print(compliment(Nucleotide))
def reversecompliment(x):
  return x[::-1]
print(reversecompliment(compliment(Nucleotide)))
